    g1 = _mm256_unpacklo_epi64(f2,f3);
    g2 = _mm256_permute2x128_si256(g0,g1,0x31);
    f0 = _mm256_unpackhi_epi64(f0,f1);
    f1 = _mm256_unpackhi_epi64(f2,f3);
    
