static void ntt768(int16 *f,int reps,const __m256i *qdata)
{
  __m256i f0,f1,f2,f3,f4,f5,g0,g1,g2,g3,g4,g5;
  int16 *origf = f;
  int rep;
  for (rep = 0;rep < reps;++rep) {
    int i;
    for (i = 0;i < 8;++i) {
      f0 = _mm256_loadu_si256((__m256i *) (f + 32*i + 0));
      f1 = _mm256_loadu_si256((__m256i *) (f + 32*i + 16));
      f2 = _mm256_loadu_si256((__m256i *) (f + 32*i + 256));
      f3 = _mm256_loadu_si256((__m256i *) (f + 32*i + 272));
      f4 = _mm256_loadu_si256((__m256i *) (f + 32*i + 512));
      f5 = _mm256_loadu_si256((__m256i *) (f + 32*i + 528));
      
      g0 = add_x16(f0,f2);
      g4 = sub_x16(f0,f2);
      f2 = mulmod_x16_scaled(qdata,f2,zeta3_x16,zeta3_x16_qinv);
      
      g1 = add_x16(f1,f3);
      g5 = sub_x16(f1,f3);
      f3 = mulmod_x16_scaled(qdata,f3,zeta3_x16,zeta3_x16_qinv);
      
      g0 = add_x16(g0,f4);
      g2 = sub_x16(f0,f4);
      f4 = mulmod_x16_scaled(qdata,f4,zeta3_x16,zeta3_x16_qinv);
      g0 = reduce_x16(qdata,g0);
      
      g1 = add_x16(g1,f5);
      g3 = sub_x16(f1,f5);
      f5 = mulmod_x16_scaled(qdata,f5,zeta3_x16,zeta3_x16_qinv);
      g1 = reduce_x16(qdata,g1);
      
      if(i < 6) {
        g2 = add_x16(g2,f2);
        g4 = sub_x16(g4,f2);
        g3 = add_x16(g3,f3);
        g5 = sub_x16(g5,f3);
        g2 = sub_x16(g2,f4);
        g4 = add_x16(g4,f4);
        g3 = sub_x16(g3,f5);
        g5 = add_x16(g5,f5);
      }
      else {
        g2 = add_x16(g2,f2);
        g4 = sub_x16(f2,g4);
        g3 = add_x16(g3,f3);
        g5 = sub_x16(f3,g5);
        g2 = sub_x16(g2,f4);
        g4 = sub_x16(g4,f4);
        g3 = sub_x16(g3,f5);
        g5 = sub_x16(g5,f5);
      }
      
      g2 = mulmod_x16_scaled(qdata,g2,zeta(768,2*i),zeta_qinv(768,2*i));
      g3 = mulmod_x16_scaled(qdata,g3,zeta(768,2*i+1),zeta_qinv(768,2*i+1));
      
      if(i < 6) {
        g4 = mulmod_x16_scaled(qdata,g4,zeta(384,2*i),zeta_qinv(384,2*i));
        g5 = mulmod_x16_scaled(qdata,g5,zeta(384,2*i+1),zeta_qinv(384,2*i+1));
      }
      else {
        g4 = mulmod_x16_scaled(qdata,g4,zeta(384,2*i-12),zeta_qinv(384,2*i-12));
        g5 = mulmod_x16_scaled(qdata,g5,zeta(384,2*i+1-12),zeta_qinv(384,2*i+1-12));
      }
      
      _mm256_storeu_si256((__m256i *) (f + 32*i + 0),g0);
      _mm256_storeu_si256((__m256i *) (f + 32*i + 16),g1);
      _mm256_storeu_si256((__m256i *) (f + 32*i + 256),g2);
      _mm256_storeu_si256((__m256i *) (f + 32*i + 272),g3);
      _mm256_storeu_si256((__m256i *) (f + 32*i + 512),g4);
      _mm256_storeu_si256((__m256i *) (f + 32*i + 528),g5);
      
    }
    f += 768;
  }
  f = origf;
  ntt256(f,reps*3,qdata);
}

